import React, { useState } from "react";
import Axios from "axios";

import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import Alert from "react-bootstrap/Alert";

export default function Register() {
  const [emailUser, setEmailUser] = useState("");
  const [nameUser, setNameUser] = useState("");
  const [surnameUser, setSurnameUser] = useState("");
  const [passwordUser, setPasswordUser] = useState("");

  const submitUser = () => {
    Axios.post("http://localhost:8000/user/register", {
      name: nameUser,
      surname: surnameUser,
      email: emailUser,
      password: passwordUser,
    }).then((response) => alert(response));
  };

  return (
    <>
      <Container>
        <Row>
          <Col className="p-5" md={{ span: 6, offset: 3 }}>
            <Form className="border border-secondary rounded p-4">
              <Form.Group controlId="formBasicEmail">
                <Form.Label>Email address</Form.Label>
                <Form.Control
                  type="email"
                  placeholder="Enter email"
                  onChange={(e) => {
                    setEmailUser(e.event.value);
                  }}
                />
                <Form.Label>Name</Form.Label>
                <Form.Control
                  type="text"
                  placeholder="Enter name"
                  onChange={(e) => {
                    setNameUser(e.event.value);
                  }}
                />
                <Form.Label>Surname</Form.Label>
                <Form.Control
                  type="text"
                  placeholder="Enter surname"
                  onChange={(e) => {
                    setSurnameUser(e.event.value);
                  }}
                />
              </Form.Group>

              <Form.Group controlId="formBasicPassword">
                <Form.Label>Password</Form.Label>
                <Form.Control
                  type="password"
                  placeholder="Password"
                  onChange={(e) => {
                    setPasswordUser(e.event.value);
                  }}
                />
              </Form.Group>

              <Button className="m-1" variant="primary">
                Register
              </Button>
              <Alert className="m-1" key="info" variant="info">
                If you have an account <Alert.Link href="#">log in</Alert.Link>{" "}
                with this link.
              </Alert>
            </Form>
          </Col>
        </Row>
      </Container>
    </>
  );
}
